import React, {Component} from 'react';
import '../App.css';
import {Navbar, Nav, Container, NavDropdown, Item} from 'react-bootstrap';
import {AiOutlineHome, AiOutlineUser, AiOutlineExport, AiOutlineMenu} from 'react-icons/ai';

export default class MyNav extends Component {
    render(){

        return(
        <div className='w-100'>
            <Navbar variant="light" className="navbar">
                <Container>
                <Navbar bg="light" variant="light" fixed="top">
                    <Container>
                    <Navbar.Brand className='navTitle' href="/">My_Events</Navbar.Brand>
                        <Nav className="icon-navbar">
                            <Nav.Link className='icon-home' href="/"><AiOutlineHome/></Nav.Link>
                            <Nav.Link className='icon-user' href="/profil"><AiOutlineUser/></Nav.Link>
                            <Nav.Link className='icon-log' href="/login"><AiOutlineExport/></Nav.Link>

                            <NavDropdown title="<AiOutlineMenu/>" id="basic-nav-dropdown"><AiOutlineMenu/>
                                <NavDropdown.Item className='icon-home' href="/"><AiOutlineHome/></NavDropdown.Item>
                                <NavDropdown.Item className='icon-user' href="/profil"><AiOutlineUser/></NavDropdown.Item>
                                <NavDropdown.Item className='icon-log' href="/login"><AiOutlineExport/></NavDropdown.Item>
                                <NavDropdown.Divider />
                                <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
                            </NavDropdown>
                        </Nav>
                    </Container>
                    {/* <SearchBar/> */}
                </Navbar>
                </Container>
            </Navbar>
        </div>

        )
    }
}
